CREATE TABLE SALES.RECORDS_AGG_COUNTRY 
USING COLUMN OPTIONS (BUCKETS '7', PARTITION_BY 'REGION', PERSISTENCE 'SYNCHRONOUS')
AS (SELECT REGION, COUNTRY, sum(unitssold) as sum_unitssold, sum(unitprice) as sum_unitprice, sum(unitcost) as sum_unitcost, sum(totalrevenue) as sum_totalrevenue, sum(totalcost) as sum_totalcost, sum(totalprofit) as sum_totalprofit FROM SALES.RECORDS GROUP BY REGION, COUNTRY ORDER BY REGION, COUNTRY);

